        if (text.find('*') == 0 && text.back() == '*') {
            html += "<strong>" + text.substr(1, text.size() - 2) + "</strong>";
        } else if (text.find('__') == 0 && text.back() == '_') {
            html += "<strong>" + text.substr(2, text.size() - 2) + "</strong>";
        }
        markdown.erase(matches.position(), matches.str().size());
    }

    // Italic text
    std::regex italicRegex("\\*([^*]|[^ ])*|~~([^~]|[^ ])*~~");
    while (std::regex_search(markdown, matches, italicRegex)) {
        std::string text = matches.str();
        if (text.find('*') == 0 && text.back() == '*') {
            html += "<i>" + text.substr(1, text.size() - 2) + "</i>";
        } else if (text.find("~~") == 0 && text.back() == '~') {
            html += "<i>" + text.substr(2, text.size() - 2) + "</i>"; // Note: ~~ is not standard markdown for italics, but a common extension
        }
        markdown.erase(matches.position(), matches.str().size());
    }

    // Links
    std::regex linkRegex("\\[(.*)\\]\\(([^)]*)\\)");
    while (std::regex_search(markdown, matches, linkRegex)) {
        std::string linkText = matches.str().substr(1, matches.str().find(']') - 1);
        std::string href = matches.str().substr(matches.str().find('(') + 1, matches.str().find(')') - matches.str().find('(') - 1);
        html += "<a href=\"" + href + "\">" + linkText + "</a>";
        markdown.erase(matches.position(), matches.str().size());
    }

    // Lists
    // ...

    html += markdown; // In case there's anything left over

    return html;
}

